import React from 'react';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  IconButton,
  Menu,
  MenuItem,
  Avatar,
  useTheme,
  useMediaQuery
} from '@mui/material';
import {
  Menu as MenuIcon,
  ShoppingCart,
  AccountCircle
} from '@mui/icons-material';
import { useAuth } from '../contexts/AuthContext';

const Navbar = () => {
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const navigate = useNavigate();
  const { user, logout } = useAuth();
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleMenu = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    logout();
    handleClose();
    navigate('/');
  };

  return (
    <AppBar position="static" color="default" elevation={1}>
      <Toolbar>
        <Typography
          variant="h6"
          component={RouterLink}
          to="/"
          sx={{
            flexGrow: 1,
            textDecoration: 'none',
            color: 'inherit',
            display: 'flex',
            alignItems: 'center'
          }}
        >
          AgriWaste Market
        </Typography>

        {isMobile ? (
          <IconButton
            edge="end"
            color="inherit"
            aria-label="menu"
            onClick={handleMenu}
          >
            <MenuIcon />
          </IconButton>
        ) : (
          <Box sx={{ display: 'flex', gap: 2 }}>
            <Button
              component={RouterLink}
              to="/marketplace"
              color="inherit"
            >
              Marketplace
            </Button>
            <Button
              component={RouterLink}
              to="/about"
              color="inherit"
            >
              About
            </Button>
            <Button
              component={RouterLink}
              to="/contact"
              color="inherit"
            >
              Contact
            </Button>
            {user ? (
              <>
                <IconButton
                  component={RouterLink}
                  to="/cart"
                  color="inherit"
                >
                  <ShoppingCart />
                </IconButton>
                <IconButton
                  onClick={handleMenu}
                  color="inherit"
                >
                  {user.avatar ? (
                    <Avatar
                      src={user.avatar}
                      alt={user.name}
                      sx={{ width: 32, height: 32 }}
                    />
                  ) : (
                    <AccountCircle />
                  )}
                </IconButton>
              </>
            ) : (
              <>
                <Button
                  component={RouterLink}
                  to="/login"
                  color="inherit"
                >
                  Login
                </Button>
                <Button
                  component={RouterLink}
                  to="/register"
                  color="primary"
                  variant="contained"
                >
                  Register
                </Button>
              </>
            )}
          </Box>
        )}

        <Menu
          anchorEl={anchorEl}
          open={Boolean(anchorEl)}
          onClose={handleClose}
        >
          {isMobile && (
            <>
              <MenuItem
                component={RouterLink}
                to="/marketplace"
                onClick={handleClose}
              >
                Marketplace
              </MenuItem>
              <MenuItem
                component={RouterLink}
                to="/about"
                onClick={handleClose}
              >
                About
              </MenuItem>
              <MenuItem
                component={RouterLink}
                to="/contact"
                onClick={handleClose}
              >
                Contact
              </MenuItem>
            </>
          )}
          {user ? (
            <>
              <MenuItem
                component={RouterLink}
                to="/profile"
                onClick={handleClose}
              >
                Profile
              </MenuItem>
              <MenuItem
                component={RouterLink}
                to="/dashboard"
                onClick={handleClose}
              >
                Dashboard
              </MenuItem>
              <MenuItem onClick={handleLogout}>
                Logout
              </MenuItem>
            </>
          ) : (
            <>
              <MenuItem
                component={RouterLink}
                to="/login"
                onClick={handleClose}
              >
                Login
              </MenuItem>
              <MenuItem
                component={RouterLink}
                to="/register"
                onClick={handleClose}
              >
                Register
              </MenuItem>
            </>
          )}
        </Menu>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
